Carry on, Jeeves is a collection of ten short stories by P. G. Wodehouse. It was first published in the UK on October 9, 1925 by Herbert Jenkins, London, and in the U.S. on October 7, 1927 by George H. Doran, New York. Many of the stories had previously appeared in the Saturday Evening Post, and some were rewritten versions of stories in the collection My Man Jeeves (1919). The book is considered part of the Jeeves canon.

Stories:

    * &quot;Jeeves Takes Charge&quot;
    * &quot;The Artistic Career of Corky&quot;
    * &quot;Jeeves and the Unbidden Guest&quot;
    * &quot;Jeeves and the Hard-boiled Egg&quot;
    * &quot;The Aunt and the Sluggard&quot;
    * &quot;The Rummy Affair of Old Biffy&quot;
    * &quot;Without the Option&quot;
    * &quot;Fixing It for Freddie&quot;
    * &quot;Clustering Round Young Bingo&quot;
    * &quot;Bertie Changes His Mind&quot;

